import styled from "styled-components";

const chat = styled.div`

    .room-name{
        margin-bottom: 0.4375em;
        font-size: 1.5em;
        padding-left: 0.25em;
    }

    .Nick{
        margin-bottom: 0.8125em;
        font-size: 1.5em;
    }


    #name, #pasword{
        font-family: Monteserrat-regular;
        color: black;
        font-weight: 400;
        margin-left: 1.0625em;

        padding: 0.3125em 0px;
        border-radius: 0.3125em;
        border: none;
    }

`
export { chat };
